    false,nt"url": null,nt"notes": "This data provides Telephone Incumbent
    Local Exchange Carrier territory information for the State of Arkansas. The database
    provides location information for use in local and regional cartographic and spatial
    analysis applications. The data set was compiled from the legal descriptions in
    the rate documents on file with the Public Service Commission. The file has not
    been certified by a Professional Surveyor. The purpose of this data is to provide
    a generalized statewide view of Telephone Local Exchange Carrier territories. The
    file has been compiled from numerous sources and as such contains errors. The data
